import React from "react";
// import CartSingleCourse from '../CartSingleCourse/CartSingleCourse';
import "./Cart.css";

const Cart = ({ cart }) => {
  return (
    <div className="cart-container  my-5 p-5">
      this is my cart
      <div className="details-container">
        {cart?.map((product) => (
          <CartSingleProduct
            key={product.id}
            course={product}
          ></CartSingleProduct>
        ))}
      </div>
      <div className="summary-container">
        <SummaryCard
          cart={cart}
          // handleBuy={handleBuy}
        ></SummaryCard>
      </div>
    </div>
  );
};

export default Cart;
